import React from "react";
import ReactDOM from "react-dom";
import "./index.css";

class Ejercicio extends React.Component {
  render() {
    return (
      <div>
        <input type="text" />
        <input type="text" />
        <input type="text" />
        <input type="text" />
      </div>
    );
  }
}

class Mas extends React.Component {
  handleClick() {
    return <Ejercicio />;
  }

  render() {
    return (
      <button
        className="btn btn-primary m-2"
        aria-label="Left Align"
        onClick={handleClick()}
      />
    );
  }
}
ReactDOM.render(<Mas />, document.getElementById("root"));
